import Layout from "../Components/Layout";
import head from "next/head";
const INDEX = (
  <div>
    <head>
      <title>Welcome</title>
    </head>
    <Layout>
      <h1>Welcome To my next Tuto</h1>
    </Layout>
  </div>
);
export default () => INDEX;
